  document.querySelectorAll('.bws-story-card').forEach(card => {
    card.style.display = (filter === 'all' || card.dataset.type === filter) ? 'block' : 'none';
  });

  // Update active button styling
  document.querySelectorAll('.bws-filter-btn').forEach(b => b.classList.remove('active'));
  btn.classList.add('active');
