    btn.addEventListener('click', () => {
      const card = btn.closest('.bws-story-card');
      const fullText = card.querySelector('.bws-element-full');
      if (fullText && card) {
        // Collapse all other cards
        document.querySelectorAll('.bws-story-card').forEach(otherCard => {
          if (otherCard !== card) {
            otherCard.classList.remove('expanded');
            const otherFullText = otherCard.querySelector('.bws-element-full');
            if (otherFullText) {
              otherFullText.classList.add('hidden');
              const toggleBtn = otherCard.querySelector('.bws-element-toggle');
              if (toggleBtn) toggleBtn.textContent = 'Read more';
            }
          }
        });

        // Toggle this one
        const isHidden = fullText.classList.contains('hidden');
        fullText.classList.toggle('hidden');
        card.classList.toggle('expanded', isHidden);
        btn.textContent = isHidden ? 'Read less' : 'Read more';
      }
    });
  });
}

